(1, 'home', 'Home', '{\"hero_banner\":{\"heading\":\"Your Trusted Marketplace for <br>Cooperative Housing Shares\",\"description\":\"<p>Discover cooperative living communities on a trusted nationwide platform across<br>the USA. Explore cooperative housing communities near me for local options. Connect with boards,<br>vendors that are already registered, and ready buyers effortlessly.<\\/p>\",\"social_links\":{\"facebook\":\"#\",\"twitter\":\"#\",\"linkedin\":\"#\",\"whatsapp\":\"#\"},\"scroll_link\":\"#property\",\"search_form\":{\"property_type_label\":\"Property Type\",\"rooms_label\":\"Rooms\",\"baths_label\":\"Baths\",\"sqfeet_label\":\"Sq Feet\",\"property_type_options\":[\"Cooperative\",\"Senior\",\"Family\"],\"rooms_placeholder\":\"Total Rooms\",\"baths_placeholder\":\"Total Baths\",\"sqfeet_placeholder\":\"Square Feet\",\"search_button_text\":\"Search\"},\"video\":\"hero_video_1763947916.mp4\",\"play_image\":\"hero_play_1763947722.png\",\"scroll_image\":\"hero_scroll_1763947722.png\"},\"properties\":{\"mini_heading\":\"Property Types\",\"heading\":\"Property Options\",\"tab_all_label\":\"View All\",\"tab_senior_55_label\":\"Senior Coop 55+\",\"tab_senior_62_label\":\"Senior Coop 62+\",\"tab_family_label\":\"Family Coop\",\"view_all_button_text\":\"View All\"},\"home_about\":{\"mini_heading\":\"About Us\",\"main_heading\":\"Empowering Communities Through Reliable Co-op Marketplace\",\"paragraph\":\"<p>CooperativeShares.com provides a housing cooperative marketplace that educates buyers and sellers, ensuring transparency, trust, and nationwide visibility.<\\/p>\",\"box_1\":{\"title\":\"Easy Listing\",\"description\":\"Post your cooperative housing listings quickly\",\"logo\":\"home_about_box_1_1763949625.png\"},\"box_2\":{\"title\":\"Premium Exposure\",\"description\":\"Featured listings get nationwide visibility\",\"logo\":\"home_about_box_2_1763949625.png\"},\"box_3\":{\"title\":\"Educational Tools\",\"description\":\"Resources on co-op housing explained\",\"logo\":\"home_about_box_3_1763949625.png\"},\"box_4\":{\"title\":\"Buyer Support\",\"description\":\"Guidance for seniors and families\",\"logo\":\"home_about_box_4_1763949625.png\"},\"more_about_btn_text\":\"More About Us\",\"more_about_btn_link\":\"about\",\"phone_text\":\"Free Consulting\",\"phone_number\":\"816-529-7022\",\"about_image\":\"home_about_1763949625.png\"},\"advertise\":{\"block_1_heading\":\"List Your Properties\",\"block_1_paragraph\":\"<p>Reach potential buyers nationwide with cooperative housing listings. Our platform ensures maximum exposure, simplifies the selling process, and educates buyers about the advantages of cooperative housing, making it easier to build trust and foster collaborative living in co-op homes.<\\/p>\",\"block_1_button_text\":\"Show Your Co-op Homes for Sale\",\"block_1_button_link\":\"#\",\"block_2_heading\":\"Manage Your Properties\",\"block_2_paragraph\":\"<p>Track inquiries, showcase units, and analyze performance in real-time. Cooperativeshares.com helps boards, developers, and vendors that are already registered manage listings efficiently while highlighting the benefits of cooperative housing and sustainable cooperative living for seniors and families alike.<\\/p>\",\"block_2_button_text\":\"Manage Affordable Housing Listings\",\"block_2_button_link\":\"#\",\"image_1\":\"advertise_1_1763950007.png\",\"image_2\":\"advertise_2_1764116436.jpg\"},\"discover\":{\"mini_heading\":\"How It Works\",\"sub_heading\":\"Browse Listing, Post Your Listing, Get Noticed, and Connect & Transact.\",\"heading\":\"Why Choose CooperativeShares.com?\",\"paragraph\":\"<p>We connect communities nationwide with cooperative housing opportunities, education, and trusted marketplace services. Providing a dedicated platform for co-op homes for sale near you, where listings are easily created with detailed descriptions, photos, pricing, and unit specifications.<br><br>With options like Featured Listing for premium visibility. Plus a trustworthy educational hub offering resources on how co-ops work, the benefits of cooperative housing, retirement housing options, and guidance on navigating the buying and selling process. Our complete database helps buyers to find exactly what they need, whether by location, price, size, or amenities.<\\/p>\",\"button_text\":\"Start Your Search Now\",\"video_file\":\"discover_video_1763950260.mp4\",\"overlay_image\":\"discover_overlay_1763950260.png\"},\"contact\":{\"mini_heading\":\"Contact Us\",\"heading\":\"Get a Free Consultation\",\"placeholders\":{\"name\":\"Your name\",\"email\":\"Your email\",\"phone\":\"Phone number\",\"service\":\"Select Service\",\"message\":\"Write Message...\",\"submit\":\"Submit Now\"},\"right_image\":\"contact_right_1763950799.png\"},\"partners\":{\"mini_heading\":\"Our Partners\",\"heading\":\"Supporting Cooperative Communities Together\",\"items\":[{\"title\":\"Mac Properties\",\"link\":\"#\",\"communities\":\"28\",\"units\":\"28\",\"cities\":\"28\",\"header_text\":\"37 Communities in Chicago\",\"image\":\"partner_1763952702_0.png\"},{\"title\":\"Mac Properties\",\"link\":\"#\",\"communities\":\"29\",\"units\":\"29\",\"cities\":\"29\",\"header_text\":\"37 Communities in Chicago\",\"image\":\"partner_1763953113_1.png\"},{\"title\":\"Mac Properties\",\"link\":\"#\",\"communities\":\"30\",\"units\":\"30\",\"cities\":\"30\",\"header_text\":\"37 Communities in Chicago\",\"image\":\"partner_1763953113_2.png\"},{\"title\":\"Mac Properties\",\"link\":\"#\",\"communities\":\"31\",\"units\":\"32\",\"cities\":\"32\",\"header_text\":\"37 Communities in Chicago\",\"image\":\"partner_1763953113_3.png\"},{\"title\":\"Mac Properties\",\"link\":\"#\",\"communities\":\"33\",\"units\":\"33\",\"cities\":\"33\",\"header_text\":\"37 Communities in Chicago\",\"image\":\"partner_1763953113_4.png\"},{\"title\":\"Mac Properties\",\"link\":\"#\",\"communities\":\"34\",\"units\":\"34\",\"cities\":\"34\",\"header_text\":\"37 Communities in Chicago\",\"image\":\"partner_1763953216_5.png\"}]},\"reviews\":{\"mini_heading\":\"Reviews\",\"heading\":\"Client Success Stories\",\"rating_image\":\"reviews_rating_1763954580.png\",\"feedback_image_1\":\"reviews_feedback_1_1763954580.png\",\"feedback_image_2\":\"reviews_feedback_2_1763954580.png\",\"items\":[{\"quote\":\"We found the perfect senior co-op housing through CooperativeShares.com. The platform is easy to\\r\\n                            navigate, informative, and trustworthy. It guided us on retirement housing options and helped us\\r\\n                            secure a co-op share with confidence.\",\"name\":\"Linda R.\",\"role\":\"Client\",\"avatar\":\"review_avatar_1763954580_0.png\"},{\"quote\":\"Listing our cooperative community was simple. CooperativeShares.com highlighted our property to\\r\\n                            interested buyers nationwide, emphasizing the benefits of cooperative housing and building\\r\\n                            community in cooperative housing\",\"name\":\"Thomas J\",\"role\":\"Client\",\"avatar\":\"review_avatar_1763955098_1.png\"},{\"quote\":\"As a retiree, I found affordable senior housing options close to family through this marketplace.\\r\\n                            The educational tools made understanding co-op housing straightforward and clear.\",\"name\":\"Karen M\",\"role\":\"Client\",\"avatar\":\"review_avatar_1763955098_2.png\"},{\"quote\":\"We needed exposure for our cooperative housing listings. This platform provided premium\\r\\n                            visibility, enabling us to sell quickly while educating buyers about cooperative housing.\",\"name\":\"Michael S\",\"role\":\"Client\",\"avatar\":\"review_avatar_1763955098_3.png\"},{\"quote\":\"CooperativeShares.com is the ultimate housing cooperative marketplace. From co-op homes for sale\\r\\n                            near me to sustainable cooperative living insights, it made buying a share in a cooperative a\\r\\n                            stress-free and enjoyable experience.\",\"name\":\"Sarah T.\",\"role\":\"Client\",\"avatar\":\"review_avatar_1763955098_4.png\"}]},\"blogs\":{\"mini_heading\":\"Our Blogs\",\"heading\":\"Latest News & Updates\",\"view_all_button_text\":\"View All\",\"view_all_button_link\":\"blogs\",\"items\":[{\"date\":\"Feb 02, 2025\",\"title\":\"The Future of Cooperative Housing in the United States\",\"slug\":\"the-future-of-cooperative-housing-in-the-united-states\",\"short_des\":\"<p>A look into the rising demand for cooperative housing, sustainability trends, and community-driven living.<\\/p>\",\"long_des\":\"<p>\\\"On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment, so blinded by desire, that they cannot foresee the pain and trouble that are bound to ensue; and equal blame belongs to those who fail in their duty through weakness of will, which is the same as saying through shrinking from toil and pain. These cases are perfectly simple and easy to distinguish. In a free hour, when our power of choice is untrammelled and when nothing prevents our being able to do what we like best, every pleasure is to be welcomed and every pain avoided. But in certain circumstances and owing to the claims of duty or the obligations of business it will frequently occur that pleasures have to be repudiated and annoyances accepted. The wise man therefore always holds in these matters to this principle of selection: he rejects pleasures to secure other greater pleasures, or else he endures pains to avoid worse pains.\\\"<\\/p>\",\"read_in_minutes\":\"4\",\"link_text\":\"Read More\",\"link_url\":\"#\",\"image\":\"blog_1764116491_0.jpg\"},{\"date\":\"Jan 15, 2025\",\"title\":\"5 Reasons Why Co-op Living Is Perfect for Seniors\",\"slug\":\"5-reasons-why-co-op-living-is-perfect-for-seniors\",\"short_des\":\"<p>Discover why senior cooperative communities are becoming a popular option for safe, affordable, and stress-free living.<\\/p>\",\"long_des\":\"<h3><strong>Section 1.10.32 of \\\"de Finibus Bonorum et Malorum\\\", written by Cicero in 45 BC<\\/strong><\\/h3><p>\\\"Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, sed quia consequuntur magni dolores eos qui ratione voluptatem sequi nesciunt. Neque porro quisquam est, qui dolorem ipsum quia dolor sit amet, consectetur, adipisci velit, sed quia non numquam eius modi tempora incidunt ut labore et dolore magnam aliquam quaerat voluptatem. Ut enim ad minima veniam, quis nostrum exercitationem ullam corporis suscipit laboriosam, nisi ut aliquid ex ea commodi consequatur? Quis autem vel eum iure reprehenderit qui in ea voluptate velit esse quam nihil molestiae consequatur, vel illum qui dolorem eum fugiat quo voluptas nulla pariatur?\\\"<\\/p><h3><strong>1914 translation by H. Rackham<\\/strong><\\/h3><p>\\\"But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness. No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful. Nor again is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but because occasionally circumstances occur in which toil and pain can procure him some great pleasure. To take a trivial example, which of us ever undertakes laborious physical exercise, except to obtain some advantage from it? But who has any right to find fault with a man who chooses to enjoy a pleasure that has no annoying consequences, or one who avoids a pain that produces no resultant pleasure?\\\"<\\/p>\",\"read_in_minutes\":\"3\",\"link_text\":\"Read More\",\"link_url\":\"#\",\"image\":\"blog_1764116491_1.jpg\"},{\"date\":\"Mar 10, 2025\",\"title\":\"Understanding Co-op Ownership vs. Traditional Homeownership\",\"slug\":\"understanding-co-op-ownership-vs-traditional-homeownership\",\"short_des\":\"<p>Learn the key differences between owning a co-op share and buying a standard home, and discover which option fits your lifestyle.<\\/p>\",\"long_des\":\"<p>\\\"Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, sed quia consequuntur magni dolores eos qui ratione voluptatem sequi nesciunt. Neque porro quisquam est, qui dolorem ipsum quia dolor sit amet, consectetur, adipisci velit, sed quia non numquam eius modi tempora incidunt ut labore et dolore magnam aliquam quaerat voluptatem. Ut enim ad minima veniam, quis nostrum exercitationem ullam corporis suscipit laboriosam, nisi ut aliquid ex ea commodi consequatur? Quis autem vel eum iure reprehenderit qui in ea voluptate velit esse quam nihil molestiae consequatur, vel illum qui dolorem eum fugiat quo voluptas nulla pariatur?\\\"<\\/p><h3><strong>1914 translation by H. Rackham<\\/strong><\\/h3><p>\\\"But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness. No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful. Nor again is there anyone who loves or pursues or desires to obtain pain of itself, because it is pain, but because occasionally circumstances occur in which toil and pain can procure him some great pleasure. To take a trivial example, which of us ever undertakes laborious physical exercise, except to obtain some advantage from it? But who has any right to find fault with a man who chooses to enjoy a pleasure that has no annoying consequences, or one who avoids a pain that produces no resultant pleasure?\\\"<\\/p>\",\"read_in_minutes\":\"5\",\"link_text\":\"Read More\",\"link_url\":\"#\",\"image\":\"blog_1764116491_2.jpg\"}]}}', 'published', '2025-11-18 13:15:00', '2025-11-26 00:21:31'),
