(3, 'contact-settings', 'Contact Settings', '{\"contact_cards\":{\"phone\":\"(816) 529-7022\",\"email\":\"info@cooperativeshares.com\",\"address\":\"520 E 4th st Tonganoxie, KS 66086\"},\"hero_text\":{\"heading\":\"Reach Out Anytime\",\"paragraph_1\":\"Have questions or need guidance? Our team is here to help you explore co-op homes for sale and understand senior cooperative housing.\",\"paragraph_2\":\"Reach out via the form below, email, or phone, and we\\u2019ll connect you with the right resources to address your questions, listings, or community needs.\",\"image\":\"hero_hero_text_1763798788.png\"},\"map_section\":{\"iframe_src\":\"<iframe\\r\\n    src=\\\"https:\\/\\/www.google.com\\/maps\\/embed?pb=!1m18!1m12!1m3!1d52784203.16337093!2d-161.37967564687162!3d36.14970978124419!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x54eab584e432360b%3A0x1c3bb99243deb742!2sUnited%20States!5e0!3m2!1sen!2s!4v1750293825685!5m2!1sen!2s\\\"\\r\\n    style=\\\"border:0;\\\"\\r\\n    allowfullscreen=\\\"\\\"\\r\\n    loading=\\\"lazy\\\"\\r\\n    referrerpolicy=\\\"no-referrer-when-downgrade\\\"\\r\\n    class=\\\"map\\\">\\r\\n<\\/iframe>\"}}', 'published', '2025-11-18 13:15:00', '2025-11-25 08:55:31'),
(4, 'cooperative-differences', 'Cooperative Differences', '{\"intro\":{\"mini_heading\":\"Cooperative Differences\",\"main_heading\":\"What Makes Co-op Housing Unique\",\"paragraph\":\"<p>Cooperative housing works differently from traditional homes. Residents purchase a co-op share, which gives them ownership in the community while they live in a specific unit. It is the kind of structure that encourages cooperation, collective responsibility, and community participation in a cooperative living community. Decisions are made jointly between the board of directors and residents. Senior cooperative housing offers security, affordability, and a peaceful, friendly environment. Members enjoy the benefits of cooperative housing, which includes shared maintenance costs, governance participation, and a stronger sense of community, making co-ops a unique and valuable housing option.<\\/p>\"},\"key_differences\":{\"main_title\":\"Key Differences\",\"closing_text\":\"Understanding these differences helps buyers and boards recognize the advantages of co-ops, whether exploring co-op homes for sale or shares.\",\"items\":[{\"title\":\"Ownership Structure\",\"description\":\"Members own shares, not individual units.\"},{\"title\":\"Community Governance\",\"description\":\"Residents participate in decision-making and board approvals.\"},{\"title\":\"Shared Benefits\",\"description\":\"Lower costs, mutual living, and stronger community bonds.\\r\\nThe benefits of cooperative housing include lower costs and collaborative management.\"},{\"title\":\"Ownership Structure\",\"description\":\"In a co-op, residents own shares, not just their unit.\\r\\n\\r\\nEach member has a voice in community governance.\\r\\n\\r\\nThis shared structure reduces costs and encourages collective responsibility.\"},{\"title\":\"Community Governance\",\"description\":\"Co-op boards manage rules, budgets, and maintenance decisions.\\r\\n\\r\\nResidents vote on policies and approve new members.\\r\\n\\r\\nCollaboration ensures communities function smoothly and reflect residents\\u2019 needs.\"},{\"title\":\"Financial Advantages\",\"description\":\"Shared ownership helps keep housing costs lower than traditional condos.\\r\\n\\r\\nMembers may access affordable senior housing options and financing tailored to co-ops.\\r\\n\\r\\nCo-ops encourage sustainable living and long-term community stability.\"},{\"title\":\"Lifestyle Benefits\",\"description\":\"Co-ops foster social engagement and collaboration among neighbors.\\r\\n\\r\\nMembers enjoy enhanced security, support networks, and a strong sense of belonging.\\r\\n\\r\\nIdeal for families, retirees, and anyone seeking a sense of connection within their community.\"},{\"title\":\"Getting Started\",\"description\":\"Learn how to buy a co-op share and navigate application processes.\\r\\n\\r\\nExplore listings and find co-op homes for sale in your preferred location.\\r\\n\\r\\nUnderstand before committing to ensure it fits your lifestyle.\"}]}}', 'published', '2025-11-18 13:15:00', '2025-11-22 18:09:10'),
(5, 'terms-conditions', 'Terms Conditions', '{\"content\":\"<p><strong>Effective Date:<\\/strong> August 29, 2025<\\/p><p>Welcome to CooperativeShares.com. By accessing or using this website, you agree to comply with and be bound by these Terms &amp; Conditions. Please read them carefully before using our platform. If you do not agree with any part of these terms, you must not use the website.<\\/p><p><strong>1. Acceptance of Terms<\\/strong><\\/p><p>By using this website, you acknowledge that you have read, understood, and agreed to these Terms &amp; Conditions, our Privacy Policy, and any other policies referenced on the site.<\\/p><p><strong>2. Use of the Website<\\/strong><\\/p><p>You agree to use this website only for lawful purposes and in a manner consistent with all applicable laws. You may use the website to:<\\/p><ul><li>Browse and search listings.<\\/li><li>Post property listings if you are authorized as a co-op board, property manager, or developer.<\\/li><li>Access educational resources and tools.<\\/li><\\/ul><p>You may not:<\\/p><ul><li>Post false, misleading, or defamatory information.<\\/li><li>Attempt to gain unauthorized access to other users\\u2019 information or accounts.<\\/li><li>Use the website for any commercial or illegal purposes not authorized by CooperativeShares.com.<\\/li><\\/ul><p><strong>3. User Accounts<\\/strong><\\/p><p>To post listings or access certain features, you may be required to create an account. You are responsible for maintaining the confidentiality of your login credentials and for all activity under your account. You agree to notify us immediately if you suspect any unauthorized use.<\\/p><p><strong>4. Listings and Content<\\/strong><\\/p><p>All listings are submitted by users (co-op boards, management companies, or developers) and represent their properties. CooperativeShares.com <strong>does not guarantee the accuracy or completeness<\\/strong> of any listing. Users are responsible for providing accurate information