in the appropriate courts in the State of Kansas.<\\/p><p><strong>11. Contact Information<\\/strong><\\/p><p>For questions regarding these Terms &amp; Conditions, please contact us:<\\/p><ul><li><strong>Email : <\\/strong><a href=\\\"mailto:info@cooperativeshares.com\\\">info@cooperativeshares.com<\\/a><\\/li><li><strong>Phone : <\\/strong><a href=\\\"tel:8165297022\\\">(816) 529-7022<\\/a><\\/li><li><strong>Address : <\\/strong>520 E. 4th St, Tonganoxie, KS 66086<\\/li><\\/ul>\"}', 'published', '2025-11-18 13:15:00', '2025-11-22 17:11:09'),
(6, 'privacy-policy', 'Privacy Policy', '{\"content\":\"<p><strong>Effective Date:<\\/strong> August 29, 2025<\\/p><p>At CooperativeShares.com, we respect your privacy and are committed to protecting the personal information you provide. This Privacy Policy explains what information we collect, how we use it, and your rights regarding your data when using our website. By accessing or using our site, you agree to the practices outlined below.<\\/p><p><strong>1. Information We Collect<\\/strong><\\/p><p>We may collect the following information:<\\/p><ul><li><strong>Personal Information:<\\/strong> Name, email address, phone number, and any details you provide when contacting us or subscribing to newsletters.<\\/li><li><strong>Technical Information:<\\/strong> IP address, browser type, operating system, and website usage information to help improve site functionality.<\\/li><li><strong>Optional Information:<\\/strong> Preferences or messages provided when submitting forms, inquiries, or feedback.<\\/li><\\/ul><p><strong>2. How We Use Your Information<\\/strong><\\/p><p>Your information is used to:<\\/p><ul><li>Respond to questions, requests, and feedback.<\\/li><li>Provide and improve our services and website features.<\\/li><li>Send updates, newsletters, or important communications if you opt in.<\\/li><li>Monitor and prevent fraudulent or unauthorized activity.<\\/li><\\/ul><p><strong>3. Sharing of Information<\\/strong><\\/p><p>We do not sell, trade, or rent your personal information. We may share information only:<\\/p><ul><li>With service providers that support website operations or communications.<\\/li><li>When required by law, legal process, or regulatory authorities.<\\/li><li>To protect the rights, property, or safety of our company or users.<\\/li><\\/ul><p><strong>4. Cookies and Tracking<\\/strong><\\/p><p>Our website uses cookies and similar technologies to enhance user experience, monitor site performance, and personalize content. You can adjust your browser settings to manage cookies.<\\/p><p><strong>5. Data Security<\\/strong><\\/p><p>We implement appropriate technical and administrative measures to protect your information from unauthorized access, disclosure, alteration, or destruction. While we strive to secure your data, no method of online transmission can guarantee 100% security.<\\/p><p><strong>6. Third-Party Links<\\/strong><\\/p><p>Our website may include links to external websites. We are not responsible for the privacy practices or content of these third-party sites. We encourage you to review their privacy policies.<\\/p><p><strong>7. Children\\u2019s Privacy<\\/strong><\\/p><p>Our site is not intended for children under 13 years old. We do not knowingly collect personal information from children. If we become aware of such data, we will promptly delete it.<\\/p><p><strong>8. Your Rights<\\/strong><\\/p><p>You may:<\\/p><ul><li>Access or update your personal information.<\\/li><li>Opt out of receiving marketing communications.<\\/li><li>Request deletion of your data, subject to legal or contractual obligations.<\\/li><\\/ul><p>To exercise these rights, please contact us at <a href=\\\"mailto:info@cooperativeshares.com\\\">info@cooperativeshares.com<\\/a><\\/p><p><strong>9. Policy Updates<\\/strong><\\/p><p>We may update this Privacy Policy occasionally. Any changes will be posted on this page with an updated effective date. We encourage users to review the policy periodically.<\\/p><p><strong>Contact Us<\\/strong><\\/p><p>For questions or concerns regarding this Privacy Policy, please reach out:<\\/p><ul><li><strong>Email : <\\/strong><a href=\\\"mailto:info@cooperativeshares.com\\\">info@cooperativeshares.com<\\/a><\\/li><li><strong>Phone : <\\/strong><a href=\\\"tel:8165297022\\\">(816) 529-7022<\\/a><\\/li><li><strong>Address : <\\/strong>520 E. 4th St, Tonganoxie, KS 66086<\\/li><\\/ul>\"}', 'published', '2025-11-18 13:15:00', '2025-11-22 17:29:16'),
(7, 'faqs', 'faqs', '{\n  \"faqs\": {\n    \"main_title\": \"Frequently Asked Questions\",\n    \"items\": [\n      {\n        \"title\": \"What types of listings can I post on CooperativeShares.com?\",\n        \"description\": \"You can list co-op homes for sale, including units for seniors, families, and developers. Each listing can include photos, pricing, and detailed unit descriptions.\"\n      },\n      {\n        \"title\": \"Can I showcase my cooperative communitys amenities and features?\",\n        \"description\": \"Yes. Listings can include detailed descriptions of the community, floor plans, photos, and amenities, helping buyers make informed decisions.\"\n      },\n      {\n        \"title\": \"Are there resources for buyers and sellers on the site?\",\n        \"description\": \"Absolutely. We provide guides, FAQs, and step-by-step instructions on how to buy a co-op share and transfer shares.\"\n      },\n      {\n        \"title\": \"Does CooperativeShares.com offer support for senior housing communities?\",\n        \"description\": \"Yes. We offer tools, educational content, and listing management features specifically designed for senior cooperative housing communities.\"\n      },\n      {\n        \"title\": \"What is the difference between a co-op and a traditional home?\",\n        \"description\": \"In a co-op, residents own shares in the building rather than the unit itself. This shared model promotes collaboration, community involvement, and potential cost savings.\"\n      },\n      {\n        \"title\": \"Why should I consider cooperative living communities?\",\n        \"description\": \"Co-op communities offer shared responsibility, transparency, lower maintenance costs, and a strong sense of community, making them a secure and engaging housing option.\"\n      },\n      {\n        \"title\": \"How is senior cooperative housing different from other housing options?\",\n        \"description\": \"Senior co-op housing combines the stability of ownership with supportive community management and social engagement tailored for older adults.\"\n      },\n      {\n        \"title\": \"How do I search for co-op homes for sale?\",\n        \"description\": \"You can use our platforms search filters to browse co-op homes for sale based on location, price, size, and available amenities.\"\n      },\n      {\n        \"title\": \"Can I find affordable housing options through co-ops?\",\n        \"description\": \"Yes. Many co-op communities offer affordable alternatives to traditional real estate, making them accessible for different income levels.\"\n      },\n      {\n        \"title\": \"Do I need an account to contact a seller or board?\",\n        \"description\": \"Yes. Creating an account allows you to securely contact sellers, boards, or property managers and receive updates about your inquiries.\"\n      },\n      {\n        \"title\": \"How do co-op share transfers work?\",\n        \"description\": \"Share transfers involve approval from the co-op board, financial verification, and signing required documents. Our guides provide detailed steps.\"\n      },\n      {\n        \"title\": \"Can developers list newly built cooperative communities?\",\n        \"description\": \"Yes. Developers can list new senior co-ops, family co-ops, and development-stage communities with full details, plans, and pricing information.\"\n      },\n      {\n        \"title\": \"Are there fees for posting a listing?\",\n        \"description\": \"Some listings may require a subscription or promotional fee depending on the visibility and category. Contact our support team for details.\"\n      },\n      {\n        \"title\": \"Can buyers request virtual tours of co-op homes?\",\n        \"description\": \"Yes. Many co-op boards and sellers offer virtual tours, photos, and video walkthroughs to help buyers evaluate units remotely.\"\n      },\n      {\n        \"title\": \"How do I update or remove my listing?\",\n        \"description\": \"Registered users can log in to their dashboard to edit, update, or remove listings anytime. Changes update instantly on the platform.\"\n      }\n    ]\n  }\n}\n', 'published', '2025-11-18 13:15:00', '2025-11-22 09:37:00'),
(9, 'about', 'about', '{\"about_main\":{\"heading_prefix\":\"About\",\"heading_highlight\":\"CooperativeShares.com\",\"tagline\":\"We Build Communities Through a Reliable Co-op Marketplace\",\"paragraph_1\":\"<p>CooperativeShares.com is a dedicated platform connecting buyers, sellers, and boards in cooperative living communities across the United States. We make it simple to explore co-op homes for sale, understand the purchasing process, and connect directly with boards, developers, and vendors that are already registered.<\\/p>\",\"paragraph_2\":\"<p>Whether you are a senior exploring retirement co-op housing or a family looking for a co-op share, our educational resources guide you through every step. We provide a transparent, trustworthy, and user-friendly environment that empowers communities and ensures residents can make informed decisions about co-op ownership.<\\/p>\",\"paragraph_3\":\"<p>We simplify cooperative homeownership by offering guidance, listings, and education for everyone interested in cooperative living.<\\/p>\",\"box_1\":{\"title\":\"Easy Listings\",\"description\":\"Quickly post your co-op homes for sale\",\"logo\":\"about_box_1_1763866749.png\"},\"box_2\":{\"title\":\"Buyer Support\",\"description\":\"Assistance for senior cooperative housing seekers\",\"logo\":\"about_box_2_1763866749.png\"},\"image_1\":\"about_about_main_1_1763867358.png\",\"image_2\":\"about_about_main_2_1763866749.png\",\"image_3\":\"about_about_main_3_1763866749.png\"},\"loop_slider\":{\"items\":[{\"text\":\"Co-op Homes for Retirees\",\"image\":\"loop_slider_1763943053_0.png\"},{\"text\":\"Senior living in Cooperative Housing\",\"image\":\"loop_slider_1763943053_1.png\"},{\"text\":\"Affordable housing through cooperatives\",\"image\":\"loop_slider_1763943053_2.png\"},{\"text\":\"Best Cooperative Housing for Seniors\",\"image\":\"loop_slider_1763943053_3.png\"},{\"text\":\"Co-op Housing for Senior Citizens\",\"image\":\"loop_slider_1763943053_4.png\"}]},\"our_story\":{\"our_story_heading\":\"Our Story\",\"our_story_paragraph_1\":\"<p>CooperativeShares.com was created to modernize the way people find and sell co-op shares. Many communities rely on word of mouth or outdated advertising, leaving buyers uncertain and listings unseen.<\\/p>\",\"our_story_paragraph_2\":\"<p>Our platform not only showcases co-op homes for sale but also provides educational support, helping people buy a co-op share with full confidence. Our mission is to make cooperative ownership accessible, trusted, and transparent, bridging the gap between buyers, sellers, and boards nationwide.<\\/p>\",\"why_choose_heading\":\"Why Choose Us?\",\"why_choose_items\":[{\"title\":\"100% Focused on Co-op Communities\",\"description\":\"Buyers can explore verified co-op homes, and sellers and boards gain nationwide exposure.\"},{\"title\":\"Simplified Process\",\"description\":\"Tools and resources make purchasing a co-op share easier and more transparent.\"},{\"title\":\"Community & Engagement\",\"description\":\"We highlight the benefits of cooperative living, including shared ownership and active participation.\"}],\"image_left\":\"about_our_story_left_1764116558.jpg\",\"image_right\":\"about_our_story_right_1763941228.png\"},\"explore_properties\":{\"heading\":\"Explore Co-op Properties\",\"paragraph_1\":\"<p>Our site allows you to search for co-op homes, view detailed listings, and discover properties suitable for families, seniors, and retirees. Each listing provides comprehensive information to help buyers make informed decisions.<\\/p>\",\"paragraph_2\":\"<p>Experience seamless access to co-op housing options with community-focused features, pricing, and listings designed to create a smooth buying experience for residents and investors alike.<\\/p>\",\"video_file\":\"explore_video_1763941843.mp4\",\"image_file\":\"explore_image_1763941843.png\"}}', 'published', '2025-11-18 13:15:00', '2025-11-26 00:22:38'),
(10, 'footer', 'footer', '{\"footer\":{\"description\":\"We connect communities nationwide with cooperative housing opportunities, education, and trusted marketplace services.\",\"social_links\":{\"facebook\":\"https:\\/\\/www.facebook.com\\/share\\/1GZnZodiGX\\/?mibextid=wwXIfr\",\"twitter\":\"#\",\"linkedin\":\"https:\\/\\/www.linkedin.com\\/company\\/cooperativeshares-com\\/\"},\"quick_links\":[{\"label\":\"Home\",\"url\":\"\",\"is_route\":true,\"route_name\":\"\\/\"},{\"label\":\"About Us\",\"url\":\"\",\"is_route\":true,\"route_name\":\"about\"},{\"label\":\"Listings\",\"url\":\"\",\"is_route\":true,\"route_name\":\"listings\"},{\"label\":\"Services\",\"url\":\"\",\"is_route\":true,\"route_name\":\"services\"},{\"label\":\"Reviews\",\"url\":\"\",\"is_route\":true,\"route_name\":\"reviews\"},{\"label\":\"Blogs\",\"url\":\"\",\"is_route\":true,\"route_name\":\"blogs\"}],\"helpful_links\":[{\"label\":\"Cooperative Differences\",\"url\":\"\",\"is_route\":true,\"route_name\":\"cooperrative-differences\"},{\"label\":\"Contact Us\",\"url\":\"\",\"is_route\":true,\"route_name\":\"contact\"},{\"label\":\"Privacy Policy\",\"url\":\"\",\"is_route\":true,\"route_name\":\"privacy-policy\"},{\"label\":\"FAQs\",\"url\":\"\",\"is_route\":true,\"route_name\":\"faq\"},{\"label\":\"Terms & Conditions\",\"url\":\"\",\"is_route\":false,\"route_name\":\"terms\"}],\"contact\":{\"phone\":\"+1 (816) 529-7022\",\"email\":\"anderson@theaapg.com\",\"address\":\"520 E 4th st Tonganoxie, KS 66086\"},\"bottom_bar\":{\"left_text\":\"\\u00a9 Copyright 2025 Cooperative Homes. All rights Reserved\",\"right_text\":\"Design & Developed by: <a href=\\\"https:\\/\\/www.webdesignglory.com\\/\\\" style=\\\"text-decoration: none; color: white;\\\">Web Design Glory<\\/a>\"},\"logo\":\"footer_logo_1763967895.jpg\"}}', 'published', '2025-11-18 13:15:00', '2025-11-25 18:21:21'),
(11, 'header', 'Header', '{\"main\":{\"top_bar\":{\"email\":\"anderson@theaapg.com\",\"phone\":\"+1 (816) 529-7022\"},\"social_links\":{\"facebook\":\"https:\\/\\/www.facebook.com\\/share\\/1GZnZodiGX\\/?mibextid=wwXIfr\",\"twitter\":\"#\",\"linkedin\":\"https:\\/\\/www.linkedin.com\\/company\\/cooperativeshares-com\\/\",\"whatsapp\":\"#\"},\"header\":{\"logo_link_route\":\"index\",\"logo\":\"header_logo_1763968965.jpg\"}}}', 'published', '2025-11-18 13:15:00', '2025-11-25 18:15:00');
