(1, 'Services-01', '<p>They abbreviated \"dolorem\" (meaning \"pain\") to \"lorem,\" which carries no meaning in Latin. \"Ipsum\" translates to \"itself,\" and the text frequently includes phrases such as \"consectetur adipiscing elit\" and \"ut labore et dolore.\" These Latin fragments, derived from Cicero\'s philosophical treatise, were rearranged to create the standard dummy text that has become a fundamental tool in design and typography across generations.</p>', '<p>They abbreviated \"dolorem\" (meaning \"pain\") to \"lorem,\" which carries no meaning in Latin. \"Ipsum\" translates to \"itself,\" and the text frequently includes phrases such as \"consectetur adipiscing elit\" and \"ut labore et dolore.\" These Latin fragments, derived from Cicero\'s philosophical treatise, were rearranged to create the standard dummy text that has become a fundamental tool in design and typography across generations.</p><p>The short answer is that lorem ipsum text doesn\'t actually \"say\" anything meaningful. It\'s deliberately scrambled Latin that doesn\'t form coherent sentences. While it comes from Cicero\'s \"De Finibus Bonorum et Malorum,\" the text has been modified so extensively that it\'s nonsensical.</p>', 'service_featured_1763386074.png', 'service_bg_1763386270.png', '2025-11-17 21:27:54', '2025-11-17 21:31:10'),
(2, 'Services-02', '<p>The short answer is that lorem ipsum text doesn\'t actually \"say\" anything meaningful. It\'s deliberately scrambled Latin that doesn\'t form coherent sentences. While it comes from Cicero\'s \"De Finibus Bonorum et Malorum,\" the text has been modified so extensively that it\'s nonsensical.</p>', '<p>They abbreviated \"dolorem\" (meaning \"pain\") to \"lorem,\" which carries no meaning in Latin. \"Ipsum\" translates to \"itself,\" and the text frequently includes phrases such as \"consectetur adipiscing elit\" and \"ut labore et dolore.\" These Latin fragments, derived from Cicero\'s philosophical treatise, were rearranged to create the standard dummy text that has become a fundamental tool in design and typography across generations.</p><p>The short answer is that lorem ipsum text doesn\'t actually \"say\" anything meaningful. It\'s deliberately scrambled Latin that doesn\'t form coherent sentences. While it comes from Cicero\'s \"De Finibus Bonorum et Malorum,\" the text has been modified so extensively that it\'s nonsensical.</p><p>Why scrambled text? That\'s exactly the point. By using text that\'s unreadable but maintains the general pattern of regular writing  including normal word length, spacing, and punctuation  designers can focus on the visual elements of a layout without the actual content getting in the way. The pseudo-Latin appearance gives it a natural feel while ensuring it won\'t distract from the design itself.</p>', 'service_featured_1763386207.png', 'service_bg_1763386207.png', '2025-11-17 21:30:07', '2025-11-17 21:30:07'),
